// import blog from '../Assets/blog-logo.svg'
// import contact from '../Assets/contact-logo.svg'

export const Banner = () => {
    
    return (
        <section className="banner" id="home">
            <Container>
                <Row className="align-items-center">
                    <Col xs={12} md={6} xl={12}>
                        <div>
                            <img src={BannerImg}></img>
                        </div>
                    </Col>
                    <Col className="" xs={12} md={6} xl={7} >
                        {/* <span className="tagline"> WELCOME TO BRILWORX </span> */}
                        <h1></h1>
                        <h1>Welcome to Cafe Creme<span className="wrap"></span></h1>
                        <p>Creative website design for start-ups, sole traders and settled businesses.</p>
                    </Col>
                </Row>
            </Container>
            <Container>
                
            </Container>
        </section>
    );
}
